		production_companies,
		production_countries,
		release_date,
		revenue,
		runtime,
		spoken_languages,
		status,
		tagline,
		title,
		vote_average,
		vote_count,
	} = props;

	console.log(props);
	return (
		<Row gutter={[16, 16]}>
